import React, { Component } from 'react';



class HeaderSub extends Component {
	constructor(){
		super()

		this.state = {

		}
	}

	render(){
		return(
			<div style={{backgroundColor:'rgb(20,20,20)', height:'60px', paddingLeft:'16px', paddingRight:'16px', display:'flex', alignItems:'center', justifyContent:'space-between'}}>
				<div>
					<span className='red'>SHOPMATE</span>
				</div>

				<div className='white'>
					<span style={{paddingLeft:'16px', paddingRight:'16px'}}><strong>Women</strong></span>
					<span style={{paddingLeft:'16px', paddingRight:'16px'}}><strong>Men</strong></span>
					<span style={{paddingLeft:'16px', paddingRight:'16px'}}><strong>Kids</strong></span>
					<span style={{paddingLeft:'16px', paddingRight:'16px'}}><strong>Shoes</strong></span>
					<span style={{paddingLeft:'16px', paddingRight:'16px'}}><strong>Brands</strong></span>
				</div>

				<div>
					<input style={{color:'white', backgroundColor:'gray', height:'32px'}} placeholder='Search' className='form-control'/>
				</div>

				<div>
					<span className='white'>User</span>
				</div>
			</div>

		);
	}
}



export default HeaderSub;
